export default {
  title: 'dark',
  colors: {
    primary: '#fff',
    background: '#121212',
    death: 'rgba(255,255,255,.87)',
    confirmed: 'hsl(0, 100%, 45%)',
    recovered: 'hsl(80, 100%, 33%)',
    mapStroke: 'rgba(255,255,255,.87)',
    text: 'rgba(255,255,255,.60)',
  },
};
